                    <h2 id="endpoints-POSTapi-auth-registrar-usuario">Registrar un nuevo usuario en el sistema.</h2>

<p>
</p>

<p>Este método permite crear un nuevo usuario, asignarle el rol de &quot;Aspirante&quot; y generar un token JWT
para su autenticación inmediata. La creación del usuario se realiza dentro de una transacción para
asegurar la integridad de los datos. Si ocurre algún error durante el proceso, se captura la excepción
y se retorna una respuesta con el mensaje de error correspondiente.</p>

<span id="example-requests-POSTapi-auth-registrar-usuario">
<blockquote>Example request:</blockquote>


<div class="bash-example">
    <pre><code class="language-bash">curl --request POST \
    "http://localhost/api/auth/registrar-usuario" \
    --header "Content-Type: multipart/form-data" \
    --header "Accept: application/json" \
    --form "municipio_id=architecto"\
    --form "tipo_identificacion=Servicio nacional de pruebas"\
    --form "numero_identificacion=n"\
    --form "genero=Masculino"\
    --form "primer_nombre=g"\
    --form "segundo_nombre=z"\
    --form "primer_apellido=m"\
    --form "segundo_apellido=i"\
    --form "fecha_nacimiento=2021-12-27"\
    --form "estado_civil=Viudo"\
    --form "email=zbailey@example.net"\
    --form "password=-0pBNvYgxw"\
    --form "archivo=@C:\Users\Lenovo\AppData\Local\Temp\phpDCB8.tmp" </code></pre></div>


<div class="javascript-example">
    <pre><code class="language-javascript">const url = new URL(
    "http://localhost/api/auth/registrar-usuario"
);

const headers = {
    "Content-Type": "multipart/form-data",
    "Accept": "application/json",
};

const body = new FormData();
body.append('municipio_id', 'architecto');
body.append('tipo_identificacion', 'Servicio nacional de pruebas');
body.append('numero_identificacion', 'n');
body.append('genero', 'Masculino');
body.append('primer_nombre', 'g');
body.append('segundo_nombre', 'z');
body.append('primer_apellido', 'm');
body.append('segundo_apellido', 'i');
body.append('fecha_nacimiento', '2021-12-27');
body.append('estado_civil', 'Viudo');
body.append('email', 'zbailey@example.net');
body.append('password', '-0pBNvYgxw');
body.append('archivo', document.querySelector('input[name="archivo"]').files[0]);

fetch(url, {
    method: "POST",
    headers,
    body,
}).then(response =&gt; response.json());</code></pre></div>

