                    <h2 id="endpoints-POSTapi-auth-iniciar-sesion">Iniciar sesión de usuario y generar token JWT.</h2>

<p>
</p>

<p>Este método valida las credenciales proporcionadas (correo y contraseña) y, si son correctas,
autentica al usuario, genera un token JWT y retorna información básica del usuario autenticado,
incluyendo su rol principal. Si la validación falla o las credenciales son incorrectas, se lanza
una excepción con el código de error correspondiente.</p>

