                    <h2 id="endpoints-POSTapi-auth-restablecer-contrasena">Enviar enlace para restablecer la contraseña del usuario.</h2>

<p>
</p>

<p>Este método valida el correo electrónico proporcionado y, si el usuario existe, genera un token único
para restablecimiento de contraseña. Luego guarda o actualiza dicho token en la tabla <code>password_reset_tokens</code>
y envía un correo electrónico al usuario con un enlace para restablecer la contraseña.
Si la validación falla o el usuario no existe, se retorna un mensaje de error.</p>

