                    <h2 id="endpoints-POSTapi-auth-actualizar-usuario">Actualizar la información del usuario autenticado.</h2>

<p>
</p>

<p>Este método permite modificar los datos del usuario actualmente autenticado. La operación se realiza
dentro de una transacción para asegurar la integridad de la información. Si se adjunta un archivo
(como un documento de identificación), este se actualiza o se crea usando el servicio <code>ArchivoService</code>.
Después de la actualización, se retorna el usuario con los datos frescos desde la base de datos,
incluyendo las URLs públicas de los documentos relacionados si existen.
En caso de error durante el proceso, se captura la excepción y se retorna una respuesta con el mensaje correspondiente.</p>

<span id="example-requests-POSTapi-auth-actualizar-usuario">
<blockquote>Example request:</blockquote>


<div class="bash-example">
    <pre><code class="language-bash">curl --request POST \
    "http://localhost/api/auth/actualizar-usuario" \
    --header "Content-Type: multipart/form-data" \
    --header "Accept: application/json" \
    --form "tipo_identificacion=Registro civil"\
    --form "numero_identificacion=b"\
    --form "genero=Masculino"\
    --form "primer_nombre=n"\
    --form "segundo_nombre=g"\
    --form "primer_apellido=z"\
    --form "segundo_apellido=m"\
    --form "fecha_nacimiento=2021-12-27"\
    --form "estado_civil=Viudo"\
    --form "archivo=@C:\Users\Lenovo\AppData\Local\Temp\phpDD55.tmp" </code></pre></div>


<div class="javascript-example">
    <pre><code class="language-javascript">const url = new URL(
    "http://localhost/api/auth/actualizar-usuario"
);

const headers = {
    "Content-Type": "multipart/form-data",
    "Accept": "application/json",
};

const body = new FormData();
body.append('tipo_identificacion', 'Registro civil');
body.append('numero_identificacion', 'b');
body.append('genero', 'Masculino');
body.append('primer_nombre', 'n');
body.append('segundo_nombre', 'g');
body.append('primer_apellido', 'z');
body.append('segundo_apellido', 'm');
body.append('fecha_nacimiento', '2021-12-27');
body.append('estado_civil', 'Viudo');
body.append('archivo', document.querySelector('input[name="archivo"]').files[0]);

fetch(url, {
    method: "POST",
    headers,
    body,
}).then(response =&gt; response.json());</code></pre></div>

