                    <h2 id="endpoints-DELETEapi-admin-eliminar-normativa--id-">Eliminar una normativa del sistema por su ID.</h2>

<p>
</p>

<p>Este método permite eliminar una normativa específica, identificada por su ID. Antes de eliminar el
registro en la base de datos, se eliminan también los archivos asociados utilizando el servicio <code>ArchivoService</code>.
La operación se ejecuta dentro de una transacción para asegurar que ambas acciones (archivo y registro)
se completen de manera atómica. En caso de que la normativa no exista o ocurra un error, se captura la excepción
y se retorna una respuesta con el mensaje de error correspondiente.</p>

