                    <h2 id="endpoints-POSTapi-aspirante-crear-rut">Crear un nuevo RUT para el usuario autenticado.</h2>

<p>
</p>

<p>Este método permite registrar un único RUT por usuario. Antes de la creación, se verifica si ya existe
un RUT asociado al usuario y, en caso afirmativo, se retorna una respuesta con código 409 (conflicto).
Si no existe, se procede a crear el registro dentro de una transacción para asegurar la integridad de los datos.
Si se adjunta un archivo (por ejemplo, el PDF del RUT), se guarda mediante el servicio <code>ArchivoService</code>.
En caso de error durante la creación o almacenamiento del archivo, se captura una excepción y se retorna una
respuesta con el mensaje de error correspondiente.</p>

<span id="example-requests-POSTapi-aspirante-crear-rut">
<blockquote>Example request:</blockquote>


<div class="bash-example">
    <pre><code class="language-bash">curl --request POST \
    "http://localhost/api/aspirante/crear-rut" \
    --header "Content-Type: multipart/form-data" \
    --header "Accept: application/json" \
    --form "numero_rut=b"\
    --form "razon_social=n"\
    --form "tipo_persona=Juridica"\
    --form "codigo_ciiu=Comercio al por mayor y al por menor; reparación de vehículos automotores y motocicletas"\
    --form "responsabilidades_tributarias=g"\
    --form "archivo=@C:\Users\Lenovo\AppData\Local\Temp\phpDEEE.tmp" </code></pre></div>


<div class="javascript-example">
    <pre><code class="language-javascript">const url = new URL(
    "http://localhost/api/aspirante/crear-rut"
);

const headers = {
    "Content-Type": "multipart/form-data",
    "Accept": "application/json",
};

const body = new FormData();
body.append('numero_rut', 'b');
body.append('razon_social', 'n');
body.append('tipo_persona', 'Juridica');
body.append('codigo_ciiu', 'Comercio al por mayor y al por menor; reparación de vehículos automotores y motocicletas');
body.append('responsabilidades_tributarias', 'g');
body.append('archivo', document.querySelector('input[name="archivo"]').files[0]);

fetch(url, {
    method: "POST",
    headers,
    body,
}).then(response =&gt; response.json());</code></pre></div>

