                    <h2 id="endpoints-PUTapi-aspirante-actualizar-informacion-contacto">Actualizar la información de contacto del usuario autenticado.</h2>

<p>
</p>

<p>Este método permite modificar el registro de información de contacto existente del usuario. La operación
se realiza dentro de una transacción para garantizar la consistencia de los datos. Si se adjunta un nuevo
archivo (como una versión actualizada de la libreta militar), se reemplaza utilizando el servicio <code>ArchivoService</code>.
En caso de que el registro no exista o se produzca un error durante el proceso, se captura la excepción
y se retorna una respuesta adecuada.</p>

<span id="example-requests-PUTapi-aspirante-actualizar-informacion-contacto">
<blockquote>Example request:</blockquote>


<div class="bash-example">
    <pre><code class="language-bash">curl --request PUT \
    "http://localhost/api/aspirante/actualizar-informacion-contacto" \
    --header "Content-Type: multipart/form-data" \
    --header "Accept: application/json" \
    --form "categoria_libreta_militar=Segunda clase"\
    --form "numero_libreta_militar=b"\
    --form "numero_distrito_militar=n"\
    --form "direccion_residencia=g"\
    --form "barrio=z"\
    --form "telefono_movil=miyvdljnikhwaykc"\
    --form "celular_alternativo=myuwpwlvqwrsitcp"\
    --form "correo_alterno=s"\
    --form "archivo=@C:\Users\Lenovo\AppData\Local\Temp\phpDF30.tmp" </code></pre></div>


<div class="javascript-example">
    <pre><code class="language-javascript">const url = new URL(
    "http://localhost/api/aspirante/actualizar-informacion-contacto"
);

const headers = {
    "Content-Type": "multipart/form-data",
    "Accept": "application/json",
};

const body = new FormData();
body.append('categoria_libreta_militar', 'Segunda clase');
body.append('numero_libreta_militar', 'b');
body.append('numero_distrito_militar', 'n');
body.append('direccion_residencia', 'g');
body.append('barrio', 'z');
body.append('telefono_movil', 'miyvdljnikhwaykc');
body.append('celular_alternativo', 'myuwpwlvqwrsitcp');
body.append('correo_alterno', 's');
body.append('archivo', document.querySelector('input[name="archivo"]').files[0]);

fetch(url, {
    method: "PUT",
    headers,
    body,
}).then(response =&gt; response.json());</code></pre></div>

