                    <h2 id="endpoints-POSTapi-aspirante-crear-eps">Registrar una nueva EPS para el usuario autenticado.</h2>

<p>
</p>

<p>Este método permite al usuario registrar una única EPS. Verifica si ya tiene una registrada y,
en caso afirmativo, retorna un error 409 (conflicto). Si no existe una EPS previa, se crea una
nueva dentro de una transacción de base de datos para asegurar la consistencia, y opcionalmente
se asocia un archivo (como soporte o certificado). Se utiliza el servicio <code>ArchivoService</code> para
gestionar la carga del archivo.</p>

