                    <h2 id="endpoints-PUTapi-aspirante-actualizar-estudio--id-">Actualizar un estudio académico del usuario autenticado.</h2>

<p>
</p>

<p>Este método permite modificar los datos de un estudio previamente registrado, asegurando que el
registro pertenezca al usuario autenticado. La operación se realiza dentro de una transacción para
garantizar la integridad de los datos. Si se adjunta un nuevo archivo, se actualiza utilizando el
servicio <code>ArchivoService</code>. En caso de que el estudio no se encuentre o ocurra un error, se captura
la excepción y se responde con el mensaje correspondiente.</p>

