    "http://localhost/api/talentoHumano/crear-contratacion/architecto" \
    --header "Content-Type: application/json" \
    --header "Accept: application/json" \
    --data "{
    \"tipo_contrato\": \"Planta\",
    \"area\": \"Facultad de Derecho, Ciencias Sociales y Politicas\",
    \"fecha_inicio\": \"2025-12-03T18:55:56\",
    \"fecha_fin\": \"2025-12-03T18:55:56\",
    \"valor_contrato\": 4326.41688,
    \"observaciones\": \"-ps$\\/u\"
}"
