                    <h2 id="endpoints-POSTapi-docente-crear-informacion-contacto">Crear información de contacto para el usuario autenticado.</h2>

<p>
</p>

<p>Este método permite registrar un único registro de información de contacto para el usuario autenticado.
Antes de crear el nuevo registro, verifica si ya existe uno y, de ser así, retorna un error 409 (conflicto).
Si no existe, procede a crear el registro dentro de una transacción y, si se adjunta un archivo (libreta militar),
se guarda utilizando el servicio <code>ArchivoService</code>. En caso de errores durante el proceso, se captura la excepción
y se retorna una respuesta con el mensaje de error.</p>

