    --header "Accept: application/json" \
    --form "municipio_id=architecto"\
    --form "categoria_libreta_militar=No tiene"\
    --form "numero_libreta_militar=n"\
    --form "numero_distrito_militar=g"\
    --form "direccion_residencia=z"\
