    --form "telefono_movil=iyvdljnikhwaykcm"\
    --form "celular_alternativo=yuwpwlvqwrsitcps"\
    --form "correo_alterno=c"\
    --form "archivo=@C:\Users\Lenovo\AppData\Local\Temp\phpE142.tmp" </code></pre></div>


