                    <h2 id="endpoints-POSTapi-docente-crear-postulacion--convocatoriaId-">Crear una postulación del usuario autenticado a una convocatoria.</h2>

<p>
</p>

<p>Este método permite que un usuario autenticado se postule a una convocatoria específica.
La operación se ejecuta dentro de una transacción para garantizar la integridad de los datos.
Se valida que:</p>
<ul>
<li>La convocatoria exista.</li>
<li>La convocatoria esté abierta (no cerrada).</li>
<li>El usuario no se haya postulado previamente a la misma convocatoria.</li>
</ul>
<p>Si esta correcto, se registra la postulación con estado inicial &quot;Enviada&quot;.
En caso de errores (convocatoria cerrada, duplicidad de postulación u otros),
